import React from "react";
import {Button} from 'antd';

const Employee = ({coordinate, id, removeItem}) => {

    const removeEmployee = () => {
        removeItem(id)
    }

    return <div >
        <div>
            <span>
                            <div>{coordinate.latitude}</div>
                            <div>{coordinate.longitude}</div>
                            <div>{coordinate.date.getDate()}.{coordinate.date.getMonth()}.{coordinate.date.getFullYear()}</div>
                            <div>{coordinate.date.getHours()}:{coordinate.date.getMinutes()}</div>

                        </span>

        </div>

        <Button danger onClick={removeEmployee}>Delete</Button>

    </div>
}

export default Employee;
